import {StyleSheet, Text, View, TextInput, TouchableOpacity} from "react-native";

const Login = () => {
  return (
    <View style={styles.container}>


        <View style={styles.infoContainer}>
          <Text style={styles.titleText}>Set Your Run</Text>
          <View style={styles.suggestedGoal}>
            <Text style={styles.altText}>Email</Text>
            <TextInput style={styles.inputBox}></TextInput>
            <Text style={styles.altText}>Password</Text>
            <TextInput secureTextEntry={true} style={styles.inputBox}></TextInput>
            <Text style={styles.altText}>Incorrect credentials, please try again.</Text>
          </View> 
        </View>
        <View style={styles.buttonBox}>
            <View style={styles.button}>
                  <TouchableOpacity>
                    <Text style={styles.defaultText}>Login</Text>
                  </TouchableOpacity>
            </View>
        </View>

    </View>
  );
}

const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: "#F5F5F5",
    fontFamily: "sf compact text",
  },

  infoContainer: {
    paddingLeft: 30,
    paddingTop: 60    
  },

  suggestedGoal: {
    width: 200
  },  

  titleText: {
    fontSize: 30,
    fontWeight: "700",
    letterSpacing: 1,
  },

  altText: {
    color: "#000",
    fontSize: 17,
    marginTop: 20,
  },

  defaultText: {
    color: "#fff",
    fontSize: 17,
  },

  inputBox: {
    marginTop: 5,
    paddingLeft: 5,
    paddingRight: 5,
    paddingBottom: 5,
    backgroundColor: "#F5F5F5",
    width: "90%",
    height: 50,
    borderRadius: 10,
    fontSize: 20
  },

  buttonBox: {
    width: "100%",
    alignItems: "center",
    position: "absolute",
    bottom: 150,
  },

  button: {
    marginTop: 7,
    width: 250,
    height: 50,
    borderRadius: 7,
    backgroundColor: "#0263FF",
    color: "white",
    alignItems: "center",
    justifyContent: "center"
  },
});

export default Login;
